Writing a block is as simple as implementing a singl method, thet serves as the main func for your extension. A struct is considered as a Rubik Block only if you implement the OnAttach method of the rubik.Block interface. So what does it look like? > myawesomeblock.go package awesome import ( "fmt" r "github.com/rubikorg/rubik"
) type BlockAwesome struct{} func (a BlockAwesome) OnAttach(app *r.App) error { // block code fmt.Println("awesome block is initialized!") return nil
} There are 2 things that catches the eye: app parameter - The app parameter is supplied to you by rubik which gives you limited access to the implementer's server. !!! Note This is not the Rubik instance itself, as this would be too big a vulnerability it supplies you with only the functions that you need to build a block. error return statement - OnAttach is called first in the boot sequence by Rubik so if you return an error the server will panic and not start, which is an intended workflow. !!! Quote If the block can not even initialize properly, it can never function properly.

